export default function Contact() {
  return (
    <>
    <div>
      <h1>Contact Page</h1>
    </div>
    <div className="row d-flex justify-content-center">
    <div className="form-group col-6">
    <input type="text" className="form-control"/>
    <input type="text" className="form-control"/>
    <input type="text" className="form-control"/>
    <textarea className="form-control"/>
    </div>
    </div>
    </>

  );
}
